package Modelo;
import java.util.*;
public class Partido {
	private String codPartido;
	public Date fechaJuego;
	Equipo equipoLoc;
	Equipo equipoVis;
	Umpire umpire;
	public int nroinnings;
	public Partido() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Partido(String codPartido, Date fechaJuego, Equipo equipoLoc,
			Equipo equipoVis, Umpire umpire, int nroinnings) {
		super();
		this.codPartido = codPartido;
		this.fechaJuego = fechaJuego;
		this.equipoLoc = equipoLoc;
		this.equipoVis = equipoVis;
		this.umpire = umpire;
		this.nroinnings = nroinnings;
	}
	
	











}
	
	
	








